import App from './App';

import { Route, Routes } from "react-router-dom"



function main() {
    return (
        <Routes>
        <Route path="/1" element={<App />} />
        <Route path="/2" element={<App />} />
        <Route path="/3" element={<App />} />
        <Route path="/4" element={<App />} />
      </Routes>
      );
  }

  export default main;
